import React from "react";
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';


export default () => {
  return (
    <Swiper
    modules={[Navigation, Pagination, Scrollbar, A11y]}
    spaceBetween={50}
    slidesPerView={1}
    navigation
    pagination={{ clickable: true }}
    scrollbar={{ draggable: true }}
    >
      <SwiperSlide>
        <img src="/images/bonus.png" alt="" style={{width:"50vh", height:"100vh"}}/>
      </SwiperSlide>
      <SwiperSlide>
        <img src="/images/free.png" alt="" style={{width:"50vh", height:"100vh"}}/>
        </SwiperSlide>
      <SwiperSlide>
        <img src="/images/promo.png" alt="" style={{width:"50vh", height:"100vh"}}/>
        </SwiperSlide>
      <SwiperSlide>
        <img src="/images/roulette.png" alt="" style={{width:"50vh", height:"100vh"}}/>
        </SwiperSlide>
  
    </Swiper>
  );
};
